import ReactDOM from "react-dom";
import React from "react";

const fName="Biswajit";
const lName="Pradhan";
const date=new Date();

ReactDOM.render(
<>
    <h1>{`My name is ${fName} ${lName}`}</h1>
    <p>{`Today's date is ${date.getDate()}.${date.getMonth()+1}.${date.getFullYear()}`}</p>
</>,
    document.getElementById("root"))
